int
bu_file_mime(const char *ext, bu_mime_context_t context)
{
    switch (context) {
        case BU_MIME_APPLICATION:
             return mime_application(ext);
             break;
        case BU_MIME_AUDIO:
             return mime_audio(ext);
             break;
        case BU_MIME_CHEMICAL:
             return mime_chemical(ext);
             break;
        case BU_MIME_IMAGE:
             return mime_image(ext);
             break;
        case BU_MIME_MESSAGE:
             return mime_message(ext);
             break;
        case BU_MIME_MODEL:
             return mime_model(ext);
             break;
        case BU_MIME_TEXT:
             return mime_text(ext);
             break;
        case BU_MIME_VIDEO:
             return mime_video(ext);
             break;
        case BU_MIME_X_DASH_CONFERENCE:
             return mime_x_DASH_conference(ext);
             break;
        default:
             return -1;
             break;
    }
    return -1;
}

