const char *
bu_file_mime_str(int t, bu_mime_context_t context)
{
    switch (context) {
        case BU_MIME_APPLICATION:
             return mime_str_application(t);
             break;
        case BU_MIME_AUDIO:
             return mime_str_audio(t);
             break;
        case BU_MIME_CHEMICAL:
             return mime_str_chemical(t);
             break;
        case BU_MIME_IMAGE:
             return mime_str_image(t);
             break;
        case BU_MIME_MESSAGE:
             return mime_str_message(t);
             break;
        case BU_MIME_MODEL:
             return mime_str_model(t);
             break;
        case BU_MIME_TEXT:
             return mime_str_text(t);
             break;
        case BU_MIME_VIDEO:
             return mime_str_video(t);
             break;
        case BU_MIME_X_DASH_CONFERENCE:
             return mime_str_x_DASH_conference(t);
             break;
        default:
             return NULL;
             break;
    }
    return NULL;
}

