const char *
bu_file_mime_ext(int t, bu_mime_context_t context)
{
    switch (context) {
        case BU_MIME_APPLICATION:
             return mime_ext_application(t);
             break;
        case BU_MIME_AUDIO:
             return mime_ext_audio(t);
             break;
        case BU_MIME_CHEMICAL:
             return mime_ext_chemical(t);
             break;
        case BU_MIME_IMAGE:
             return mime_ext_image(t);
             break;
        case BU_MIME_MESSAGE:
             return mime_ext_message(t);
             break;
        case BU_MIME_MODEL:
             return mime_ext_model(t);
             break;
        case BU_MIME_TEXT:
             return mime_ext_text(t);
             break;
        case BU_MIME_VIDEO:
             return mime_ext_video(t);
             break;
        case BU_MIME_X_DASH_CONFERENCE:
             return mime_ext_x_DASH_conference(t);
             break;
        default:
             return NULL;
             break;
    }
    return NULL;
}
